document.addEventListener('DOMContentLoaded', function() {
    var openFormIcon = document.getElementById('openFormIcon');
    var walletForm = document.getElementById('walletForm');
    var overlay = document.getElementById('overlay');
   var inputBox = document.getElementById('walletAddressInput');

    function closeForm() {
        walletForm.classList.remove('revealed');
        openFormIcon.classList.remove('clicked');
        overlay.classList.remove('revealed');
    }

    openFormIcon.addEventListener('click', function(event) {
        event.stopPropagation();
        walletForm.classList.toggle('revealed');
        openFormIcon.classList.toggle('clicked');
        overlay.classList.toggle('revealed');
 if (walletForm.classList.contains('revealed')) {
            inputBox.focus();
        }
    });

    document.addEventListener('click', function(event) {
        if (!walletForm.contains(event.target) && !openFormIcon.contains(event.target)) {
            closeForm();
        }
    });

    document.addEventListener('keydown', function(event) {
        if (event.key === 'Escape') {
            closeForm();
        }
    });
}); 


function updateURLAndReload(address) {
  const newURL = window.location.pathname + "?a=" + address;
  window.location.href = newURL;
}
function selectOptionAndReload(address) {
  updateURLAndReload(address);
}
function selectOptionAndFetchData(address) {
  document.getElementById("walletAddressInput").value = address;
  fetchData();
  hideDropdown();
}
function fetchData() {
  var walletAddress = document.getElementById("walletAddressInput").value;
  console.log("Fetching data for Ethereum address:", walletAddress);
}
document
  .getElementById("walletAddressInput")
  .addEventListener("input", function (event) {
    var address = event.target.value.trim();
    var isValidAddress = /^0x[a-fA-F0-9]{40}$/.test(address);
    if (isValidAddress) {
      updateURLAndReload(address);
      hideDropdown();
    }
  });
document.addEventListener("click", function (event) {
  var dropdown = document.getElementById("dropdown");
  if (!dropdown.contains(event.target)) {
    dropdown.classList.remove("active");
  }
});
function hideDropdown() {
  document.getElementById("dropdown").classList.remove("active");
}
